    return(
       <section>
        <div className='container'>



        <Image src={hero} className='hero'/>
        <div class="bottom-left">

        <h1 className='heading'>Integrated payroll and accounting for streamlined production processes</h1>
        <p>Your all-in-one solution for production accounting and payroll is here. With streamlined onboarding, shortened processing times, and industry-leading service</p>
        <Button variant="primary">Login    <i class="fa-solid fa-angle-right"></i></Button>

        </div>

        </div>
       </section>
    )
}
